import React from "react"
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Home from "./pages/home/Home";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home/>}/>
        {/* <Route path="/hotels" element={<List/>}/>
        <Route path="/hotels/:id" element={<Renter/>}/> */}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
